import "./components/signup.css"

export default function SignupPage() {
  return (
    <div className="main-container">
      <div className="">
        <h1 className="">Indian Food is<br/>more than curry</h1>
        <p className="">
          Learn more about dishes, ingredients, cultures in Indian cuisine.
        </p>
        <p className="">Stop wondering, Join now</p>
      </div>
    </div>
  );
}
